                                <h2>
                                    <span> Our core values </span>
                                    <span></span>
                                </h2>
                                <div class=""about-platform__all__core-values flex-md-col"">
                                    <div class=""about-platform__all__core-values__item"">
                                        <iconify-icon icon=""pepicons:heart-print""></iconify-icon>

                                        <h3>Adopt a customer-first mindset</h3>
                                        <p>
                                            Authentically serve our customers by empowering,
                                            li");
                WriteLiteral(@"stening, and collaborating with our fellow Stackers.
                                        </p>
                                    </div>
                                    <div class=""about-platform__all__core-values__item"">
                                        <iconify-icon icon=""emojione-monotone:waving-hand""></iconify-icon>
                                        <h3>Be flexible and inclusive</h3>
                                        <p>
                                            We do our best work when a diverse group of people
                                            collaborate in an environment of respect and trust. Create
                                            space for different voices to be heard, and allow
                                            flexibility in how people work.
                                        </p>
                                    </div>
                                    <div class=""about-platform__all__core-values__item"">
                       ");
                WriteLiteral(@"                 <iconify-icon icon=""clarity:compass-line""></iconify-icon>
                                        <h3>Be transparent</h3>
                                        <p>
                                            Communicate openly and honestly, both inside and outside
                                            the company. Encourage transparency from others by being
                                            empathetic, reliable, and acting with integrity.
                                        </p>
                                    </div>
                                    <div class=""about-platform__all__core-values__item"">
                                        <iconify-icon icon=""gis:network-o""></iconify-icon>
                                        <h3>Empower people to deliver outstanding results</h3>
                                        <p>
                                            Give people space to get their job done, support them when
